import React from 'react';
import { connect } from 'react-redux';
import { headerAccepted } from '../actions';

class LocationMainPage extends React.Component {
    constructor(props) {
        super(props);
        this.props.headerAccepted(false);
        setTimeout(() => {this.props.headerAccepted(true)}, 100);
    }

    render() {
        return (
                <section className="about">
                    <div className={`"about-title"`}>The is 10 years of trust behind us.</div>
                    
                </section>
        );
    };
};

export default connect(null, { headerAccepted })(LocationMainPage);
